"use strict";(globalThis.webpackChunkgodseye=globalThis.webpackChunkgodseye||[]).push([[2426],{1834(e){e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"architectureSidebar":[{"type":"link","href":"/godseye/","label":"\ud83d\udd2d GodsEye Platform Architecture","docId":"overview","unlisted":false},{"type":"category","label":"\ud83c\udfd7\ufe0f Architecture","collapsed":false,"items":[{"type":"link","href":"/godseye/architecture/five-layers","label":"\ud83d\udcd0 Five-Layer Architecture","docId":"architecture/five-layers","unlisted":false},{"type":"link","href":"/godseye/architecture/infrastructure","label":"\u2601\ufe0f Multi-Cloud Infrastructure","docId":"architecture/infrastructure","unlisted":false},{"type":"link","href":"/godseye/architecture/engineering-platform","label":"\ud83d\udee0\ufe0f Engineering Platform","docId":"architecture/engineering-platform","unlisted":false},{"type":"link","href":"/godseye/architecture/ai-engine","label":"\ud83e\udde0 AI & Intelligence Engine","docId":"architecture/ai-engine","unlisted":false},{"type":"link","href":"/godseye/architecture/business-operations","label":"\ud83d\udcbc Business Operations","docId":"architecture/business-operations","unlisted":false},{"type":"link","href":"/godseye/architecture/customer-experience","label":"\ud83d\udecd\ufe0f Customer Experience Layer","docId":"architecture/customer-experience","unlisted":false}],"collapsible":true},{"type":"category","label":"\u2699\ufe0f Core Systems","collapsed":false,"items":[{"type":"link","href":"/godseye/systems/authentication","label":"\ud83d\udd10 Authentication & Identity System","docId":"systems/authentication","unlisted":false},{"type":"link","href":"/godseye/systems/payments","label":"\ud83d\udcb3 Payment Gateway Orchestrator","docId":"systems/payments","unlisted":false},{"type":"link","href":"/godseye/systems/load-balancing","label":"\ud83c\udf10 Global Load Balancing & Traffic Management","docId":"systems/load-balancing","unlisted":false},{"type":"link","href":"/godseye/systems/data-sync","label":"\ud83d\udd04 Cross-Cloud Data Synchronization","docId":"systems/data-sync","unlisted":false},{"type":"link","href":"/godseye/systems/pos","label":"\ud83d\udda5\ufe0f Point of Sale System","docId":"systems/pos","unlisted":false},{"type":"link","href":"/godseye/systems/commerce-engine","label":"\ud83d\uded2 Headless Commerce Engine","docId":"systems/commerce-engine","unlisted":false}],"collapsible":true},{"type":"category","label":"\ud83e\udd16 AI Agents","collapsed":false,"items":[{"type":"link","href":"/godseye/ai/agent-mesh","label":"\ud83d\udd78\ufe0f AI Agent Mesh","docId":"ai/agent-mesh","unlisted":false},{"type":"link","href":"/godseye/ai/customer-ai","label":"\ud83d\uded2 Customer AI Agents","docId":"ai/customer-ai","unlisted":false},{"type":"link","href":"/godseye/ai/operations-ai","label":"\u26a1 Operations AI Agents","docId":"ai/operations-ai","unlisted":false},{"type":"link","href":"/godseye/ai/business-ai","label":"\ud83d\udcca Business AI Agents","docId":"ai/business-ai","unlisted":false},{"type":"link","href":"/godseye/ai/project-sentinels","label":"\ud83d\udee1\ufe0f Project Sentinel Agents","docId":"ai/project-sentinels","unlisted":false},{"type":"link","href":"/godseye/ai/triplet-loss-architecture","label":"\ud83c\udfaf Triplet Loss Embeddings","docId":"ai/triplet-loss-architecture","unlisted":false}],"collapsible":true},{"type":"category","label":"\ud83d\udccb Strategy","collapsed":false,"items":[{"type":"link","href":"/godseye/strategy/build-vs-buy","label":"\ud83d\udd28 Build vs Buy Strategy","docId":"strategy/build-vs-buy","unlisted":false},{"type":"link","href":"/godseye/strategy/multi-cloud","label":"\u2601\ufe0f Multi-Cloud Strategy","docId":"strategy/multi-cloud","unlisted":false},{"type":"link","href":"/godseye/strategy/multi-tenant","label":"\ud83c\udfe2 Multi-Tenant Architecture","docId":"strategy/multi-tenant","unlisted":false},{"type":"link","href":"/godseye/strategy/triplet-model","label":"\ud83d\udd3a Triplet Model","docId":"strategy/triplet-model","unlisted":false},{"type":"link","href":"/godseye/strategy/tech-stack","label":"\ud83d\udd27 Technology Stack","docId":"strategy/tech-stack","unlisted":false},{"type":"link","href":"/godseye/strategy/open-core","label":"\ud83d\udcb0 Open-Core Strategy","docId":"strategy/open-core","unlisted":false},{"type":"link","href":"/godseye/strategy/community","label":"\ud83e\udd1d Community Strategy","docId":"strategy/community","unlisted":false}],"collapsible":true}]},"docs":{"ai/agent-mesh":{"id":"ai/agent-mesh","title":"AI Agent Mesh","description":"GodsEye runs 20+ AI agents across four families, plus 100-200 per-project Sentinel Agents that patrol individual cloud projects. The Agent Mesh is the coordination layer that routes requests, enforces safety boundaries, manages shared memory, selects the right LLM for every task, and connects the sentinel fleet via industry-standard protocols.","sidebar":"architectureSidebar"},"ai/business-ai":{"id":"ai/business-ai","title":"Business AI Agents","description":"Six autonomous agents that optimize retail operations end-to-end: predict demand, set prices, balance inventory, catch fraud, understand customers, and manage the supply chain. Every agent feeds the Knowledge Graph and consumes from it -- decisions compound.","sidebar":"architectureSidebar"},"ai/customer-ai":{"id":"ai/customer-ai","title":"Customer AI Agents","description":"Customer AI is the customer-facing agent family. Four agents handle shopping assistance, visual search, customer service, and personalization. All run through the Agent Mesh orchestrator and share the per-tenant Knowledge Graph.","sidebar":"architectureSidebar"},"ai/operations-ai":{"id":"ai/operations-ai","title":"Operations AI Agents","description":"Six autonomous agents that keep GodsEye running 24/7 across all clouds, all channels, all stores. Five central agents handle platform-wide operations, plus a fleet of Project Sentinel Agents -- one per cloud project -- that patrol individual projects 24/7 with day/night duty cycles.","sidebar":"architectureSidebar"},"ai/project-sentinels":{"id":"ai/project-sentinels","title":"Project Sentinel Agents","description":"One autonomous agent per cloud project. 100-200 sentinels across the org, each one seeping into every crevice of its assigned project -- finding vulnerabilities, checking health, fixing minor issues, and reporting daily to the responsible engineers. At night, sentinels collaborate with each other, share learnings, and research improvements.","sidebar":"architectureSidebar"},"ai/triplet-loss-architecture":{"id":"ai/triplet-loss-architecture","title":"Triplet Loss Embedding Architecture","description":"GodsEye uses triplet loss to learn unified product embeddings powering visual search, product matching, recommendations, and fraud detection. All training, serving, and storage runs on the Big 3 cloud providers (AWS primary, GCP secondary, Azure tertiary) \u2014 no private data centers.","sidebar":"architectureSidebar"},"architecture/ai-engine":{"id":"architecture/ai-engine","title":"\ud83e\udde0 Layer 3 \u2014 AI & Intelligence Engine","description":"GodsEye AI layer: 22+ central autonomous agents across 4 families, plus a fleet of 100-200 per-project Sentinel Agents -- unified by a shared Knowledge Graph, multi-provider LLM Gateway, and inter-agent communication via A2A and MCP protocols. Every agent decision is auditable. Trust levels gate what actions agents can take without human approval.","sidebar":"architectureSidebar"},"architecture/business-operations":{"id":"architecture/business-operations","title":"\ud83d\udcbc Layer 4 \u2014 Business Operations","description":"GodsEye replaces the patchwork of Oracle Retail, SAP, Salesforce, Manhattan, and Blue Yonder with a unified, AI-native business operations layer. 12 modules, single data model, real-time event-driven.","sidebar":"architectureSidebar"},"architecture/customer-experience":{"id":"architecture/customer-experience","title":"Customer Experience Layer","description":"Every surface the shopper touches. All channels share a single unified session, cart, and customer profile backed by Layer 4 services. AI personalization from Layer 3 is injected at every touchpoint in real time.","sidebar":"architectureSidebar"},"architecture/engineering-platform":{"id":"architecture/engineering-platform","title":"\ud83d\udee0\ufe0f Layer 2 -- Engineering Platform","description":"12 modules. One control plane. Everything a mid-market retailer needs to build, ship, secure, and operate software -- without assembling 40 vendors.","sidebar":"architectureSidebar"},"architecture/five-layers":{"id":"architecture/five-layers","title":"\ud83d\udcd0 Five-Layer Architecture","description":"Inter-Layer Data Flow","sidebar":"architectureSidebar"},"architecture/infrastructure":{"id":"architecture/infrastructure","title":"\u2601\ufe0f Layer 1 -- Multi-Cloud Infrastructure","description":"The Triplet Model -- Three Clouds, Zero Data Centers, Never Go Down. See Triplet Model Strategy for the full methodology.","sidebar":"architectureSidebar"},"overview":{"id":"overview","title":"\ud83d\udd2d GodsEye Platform Architecture","description":"GodsEye is the complete AI-first technology spine for mid-market retail ($1-50B revenue). One platform replaces your entire vendor stack -- ERP, commerce, CRM, observability, consulting, and infrastructure -- with 36 integrated components, 22+ central AI agents, 100-200 per-project Sentinel agents, and multi-cloud resilience across AWS, GCP, and Azure.","sidebar":"architectureSidebar"},"strategy/build-vs-buy":{"id":"strategy/build-vs-buy","title":"Build vs Buy Strategy","description":"Core Principle: Start with third-party dependencies, gradually decouple and build our own services.","sidebar":"architectureSidebar"},"strategy/community":{"id":"strategy/community","title":"Community Contribution Strategy","description":"The open-source community doesn\'t just use GodsEye \u2014 they build it. Every connector, plugin, template, bug fix, and doc improvement accelerates the platform faster than any internal engineering team could alone.","sidebar":"architectureSidebar"},"strategy/multi-cloud":{"id":"strategy/multi-cloud","title":"Multi-Cloud Strategy","description":"The Triplet Model: GodsEye runs on AWS (primary), GCP (secondary), and Azure (tertiary) \u2014 three clouds, zero data centers. Every layer of the stack \u2014 infrastructure, development, data, AI, and operations \u2014 is distributed across this triangle. See Triplet Model Strategy for the full methodology.","sidebar":"architectureSidebar"},"strategy/multi-tenant":{"id":"strategy/multi-tenant","title":"Multi-Tenant Architecture","description":"GodsEye uses a Bridge Model multi-tenancy approach -- a tiered isolation strategy that lets each tenant operate at the isolation level matching their size, compliance posture, and budget. Tenant tiers map to pricing tiers: Free users get Standard isolation, Team gets Enterprise isolation, Enterprise gets Premium isolation.","sidebar":"architectureSidebar"},"strategy/open-core":{"id":"strategy/open-core","title":"Open-Core Monetization Strategy","description":"The code is free. That\'s not a bug \u2014 it\'s the distribution strategy.","sidebar":"architectureSidebar"},"strategy/tech-stack":{"id":"strategy/tech-stack","title":"Technology Stack","description":"Complete technology stack for the GodsEye platform with rationale for each choice.","sidebar":"architectureSidebar"},"strategy/triplet-model":{"id":"strategy/triplet-model","title":"Triplet Model \u2014 Cloud-Native Development Strategy","description":"Three clouds. Zero data centers. One unified methodology for development, deployment, data, and AI.","sidebar":"architectureSidebar"},"systems/authentication":{"id":"systems/authentication","title":"\ud83d\udd10 Authentication & Identity System","description":"GodsEye identity layer: multi-cloud active-active Keycloak federation. Four identity types, RBAC hierarchy, offline-capable POS auth. Zero-trust architecture throughout.","sidebar":"architectureSidebar"},"systems/commerce-engine":{"id":"systems/commerce-engine","title":"\ud83d\uded2 Headless Commerce Engine","description":"GodsEye Commerce is a headless API-first engine that powers every selling channel -- web, mobile, POS, social, voice, and marketplace. A single backend, many frontends.","sidebar":"architectureSidebar"},"systems/data-sync":{"id":"systems/data-sync","title":"\ud83d\udd04 Cross-Cloud Data Synchronization","description":"GodsEye operates across AWS (primary), GCP (secondary), and Azure (tertiary). Every byte of data has a classification tier, a sync method, and a conflict resolution strategy. No exceptions.","sidebar":"architectureSidebar"},"systems/load-balancing":{"id":"systems/load-balancing","title":"\ud83c\udf10 Global Load Balancing & Traffic Management","description":"GodsEye traffic layer: GeoDNS + CDN edge + per-cloud LBs + Istio service mesh. Priority-based traffic shaping ensures checkout/payments never degrade. Multi-cloud failover in under 60 seconds.","sidebar":"architectureSidebar"},"systems/payments":{"id":"systems/payments","title":"\ud83d\udcb3 Payment Gateway Orchestrator","description":"GodsEye payment layer: multi-gateway smart routing, PCI-DSS Level 1 tokenization, offline-capable POS, AI-driven fraud and cost optimization. All gateways remain third-party -- GodsEye never processes raw card data.","sidebar":"architectureSidebar"},"systems/pos":{"id":"systems/pos","title":"\ud83d\udda5\ufe0f Point of Sale System","description":"GodsEye POS is a PWA that runs on iPad, Android tablets, and Windows terminals. It operates fully offline, syncs when connected, and integrates all omnichannel workflows. This is core IP -- built in-house from day one.","sidebar":"architectureSidebar"}}}}')}}]);